import Product from "./product.json";
import { Box, Image, Text } from "@chakra-ui/react";

const CartItems = () => {
  return (
    <>
      {Product.items.map((items, index) => {
        console.log(items.fields);
        return (
          <>
            <Image key={index} src={items.fields.image} />
            
          </>
        );
      })}
    </>
  );
};

export default CartItems;
